import './App.css';
import SignInForm from './frontend/components/signin';
import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Chatbot from './frontend/components/chatbot';


function App() {
  return (
    // <div className="App">

    // </div>

    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">SignIn</Link>
            </li>
            <li>
              <Link to="/chatbot">Chatbot</Link>
            </li>
          </ul>
        </nav>

        <Route path="/" exact component={SignInForm} />
        <Route path="/chatbot" component={Chatbot} />
        <SignInForm/>
      </div>
    </Router>
  );
}

export default App;
